actions.script:
const serverResponse = runtime.globalVars.serverMessage;
const serverResponseJSON = JSON.parse(serverResponse);

const car = runtime.objects.car.getFirstInstance();

if(serverResponseJSON.parkingSimulator === runtime.globalVars.id) {
	// id sie zgadza - otworz odpowiednia bramke
	const gateId = parseInt(serverResponseJSON.parkingColumnId);

	let gate;

	switch(gateId) {
		case 1:
			gate = runtime.objects.sectorAind1.getFirstInstance();
			if(car.testOverlap(gate)) {
				runtime.globalVars.openGate1 = true;
			}
			else {
				runtime.globalVars.gate1NotStanding = true;
			}

			break;
		case 2:
			gate = runtime.objects.sectorAind3.getFirstInstance();
			if(car.testOverlap(gate)) {
				runtime.globalVars.openGate2 = true;
			}
			else {
				runtime.globalVars.gate2NotStanding = true;
			}

			break;
		case 3:
			gate = runtime.objects.sectorBind1.getFirstInstance();
			if(car.testOverlap(gate)) {
				runtime.globalVars.openGate3 = true;
			}
			else {
				runtime.globalVars.gate3NotStanding = true;
			}

			break;
		case 4:
			gate = runtime.objects.sectorBind3.getFirstInstance();
			if(car.testOverlap(gate)) {
				runtime.globalVars.openGate4 = true;
			}
			else {
				runtime.globalVars.gate4NotStanding = true;
			}

			break;
		case 5:
			gate = runtime.objects.sectorCind1.getFirstInstance();
			if(car.testOverlap(gate)) {
				runtime.globalVars.openGate5 = true;
			}
			else {
				runtime.globalVars.gate5NotStanding = true;
			}

			break;
		case 6:
			gate = runtime.objects.sectorCind3.getFirstInstance();
			if(car.testOverlap(gate)) {
				runtime.globalVars.openGate6 = true;
			}
			else {
				runtime.globalVars.gate6NotStanding = true;
			}

			break;
		case 7:
			gate = runtime.objects.sectorDind1.getFirstInstance();
			if(car.testOverlap(gate)) {
				runtime.globalVars.openGate7 = true;
			}
			else {
				runtime.globalVars.gate7NotStanding = true;
			}

			break;
		default:
			gate = runtime.objects.sectorDind3.getFirstInstance();
			if(car.testOverlap(gate)) {
				runtime.globalVars.openGate8 = true;
			}
			else {
				runtime.globalVars.gate8NotStanding = true;
			}

			break;
	}

	runtime.globalVars.serverMessageReceived = true;
}
